let posts = [
  {id: 1, post:'I love you', likeCount: 15}, 
  {id: 2, post:'Follow me', likeCount: 11}
]

ReactDOM.render(
  <React.StrictMode>
    <App posts = {posts} />
  </React.StrictMode>,
  document.getElementById('root')
);

// dialogs = {dialogs} massages = {massages}

